import './Notifications.css';
function Notifications(){
return(
	<div className="Notifications" style={{'border': 'dashed', "height": "120px", "border-color": "red"}}>
          <p style={{float: "left"}}>Here is the list of notifications</p>
	  <button style={{float: "right"}} aria-label="close" onclick={console.log('Close button has been clicked')}>
            <img alt="closeButton" src="" />
	  </button>
	<ul style={{float: "left", position: "absolute", "margin-top": "50px"}}>
          <li dataset={{text: "default"}}>New course availabe</li>
	  <li>New resume available</li>
	  <li><strong>Urgent requirement</strong> - complete by EOD</li>
	</ul>
	</div>
);
}
export default Notifications;
